import React from 'react';
import PopSearchHeader from './PopSearchHeader';
import YouTubeEmbed from '../../components/youtube-embed/YouTubeEmbed';

const PopYTpage = (props) => (
	<div>
		<PopSearchHeader />
		<YouTubeEmbed videoId={props.url} />
	</div>
)

export default PopYTpage;
